import React from 'react'

import { NavLink } from "react-router-dom";

import COLORS from "../../assets/COLORS.JPG";
import ORANGEGRADIENT from "../../assets/ORANGE.png";

import "./Projects.css";

export default class Projects extends React.Component {
    componentDidMount() {
        window.scrollTo(0, 0);
      }

    render() {
        return (
            <div className="ContextContainer">
        <div className="uk-flex uk-flex-center MenuBar ">
          <NavLink to="/home" activeClassName="ItemSelected">
            <p className="MenuItem">Home</p>
          </NavLink>
          <NavLink to="/about" activeClassName="ItemSelected">
            <p className="MenuItem">About</p>
          </NavLink>
          <NavLink to="/experience" activeClassName="ItemSelected">
            <p className="MenuItem">Experience</p>
          </NavLink>
          <NavLink to="/contact" activeClassName="ItemSelected">
            <p className="MenuItem">Contact</p>
          </NavLink>
        </div>

        <div style={{ height: "2vh" }}>&nbsp;</div>

        {/* ---------- */}
        {/* CONTENT */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + COLORS + ")" }}
            data-uk-parallax="bgy: -200"
          >
            <h1 data-uk-parallax="y: -200; easing: 0.5" id="CardName">
              projects
            </h1>
          </div>
        </div>

        {/* ---------- */}
        {/* P01 */}
        {/* ---------- */}

        <div className="uk-flex uk-flex-center uk-flex-middle Content">
        <div
            className="BaseCard uk-cover-container"
          >
              <video src="https://www.youtube.com/embed/a9rAYMNuKzM" autoPlay loop muted playsInline data-uk-cover>

              </video>
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              01 - faltan macbooks
            </h1>
          </div>
        </div>


        {/* ---------- */}
        {/* P02 */}
        {/* ---------- */}

        <div style={{ height: "20vh" }}>&nbsp;</div>
        <div className="uk-flex uk-flex-center uk-flex-middle Content">
          <div
            className="BaseCard"
            style={{ backgroundImage: "url(" + ORANGEGRADIENT + ")" }}
          >
            <h1
              data-uk-parallax="y: -100; easing: 1"
              id="CardName"
              style={{ left: "-5%" }}
            >
              02 - poner algo representante de monitoria
            </h1>
          </div>
        </div>


        <div style={{ height: "10vh" }}>&nbsp;</div>
      </div>
        )
    }
}
